import React from 'react'
import Nav from 'react-bootstrap/Nav'
import NavDropdown from 'react-bootstrap/NavDropdown'
import Navbar from 'react-bootstrap/NavBar'
import logIn from "../img/logIn.png"
const UserHeader=()=>{
  return(
      //   <Navbar bg="secondary" style={{height:80 + 'px'}} expand="lg">
      //   <Navbar.Brand href="#home" style={{fontSize: 40 + 'px',color:'#ffebee'}} class="navbar-toggler">Testex</Navbar.Brand>
      //   <Navbar.Toggle aria-controls="basic-navbar-nav" />
      //   <Navbar.Collapse id="responsive-navbar-nav">
      //     <Nav className="mr-auto">
      //       <Nav.Link href="#home" style={{fontSize: 22 + 'px',marginLeft:50+'px',color:"White"}}>Home</Nav.Link>
      //       <Nav.Link href="#link" style={{fontSize: 22 + 'px',color:"White"}}>Tests</Nav.Link>
      //       <NavDropdown title={"Information"} style={{fontSize: 22 + 'px',zIndex:3}} >
      //         <NavDropdown.Item href="#action/3.1" style={{fontSize: 20 + 'px'}}>Contacts</NavDropdown.Item>
      //         <NavDropdown.Item href="#action/3.2" style={{fontSize: 20 + 'px'}}>Problems</NavDropdown.Item>
      //         <NavDropdown.Divider />
      //         <NavDropdown.Item href="#action/3.4">FeedBack</NavDropdown.Item>
      //       </NavDropdown>
      //     </Nav>
      //     <Nav.Link><img src={logIn} style={{height: 85 + 'px',float:'right'}}></img></Nav.Link>
      //   </Navbar.Collapse>
      // </Navbar>
      <Navbar collapseOnSelect expand="lg" bg="grey" variant="dark">
  <Navbar.Brand href="#home" style={{fontSize: 40 + 'px',color:'#ffebee'}}>Testex</Navbar.Brand>
  <Navbar.Toggle aria-controls="responsive-navbar-nav" />
  <Navbar.Collapse id="responsive-navbar-nav">
    <Nav className="mr-auto">
      <Nav.Link href="#features">Features</Nav.Link>
      <Nav.Link href="#pricing">Pricing</Nav.Link>
      <NavDropdown title="Dropdown" id="collasible-nav-dropdown">
        <NavDropdown.Item href="#action/3.1">Action</NavDropdown.Item>
        <NavDropdown.Item href="#action/3.2">Another action</NavDropdown.Item>
        <NavDropdown.Item href="#action/3.3">Something</NavDropdown.Item>
        <NavDropdown.Divider />
        <NavDropdown.Item href="#action/3.4">Separated link</NavDropdown.Item>
      </NavDropdown>
    </Nav>
    <Nav>
      <Nav.Link href="#deets">More deets</Nav.Link>
      <Nav.Link eventKey={2} href="#memes">
        Dank memes
      </Nav.Link>
    </Nav>
  </Navbar.Collapse>
</Navbar>
  );
}
export default UserHeader;
